INSERT INTO `onl_cgreport_head` VALUES ('1553275622972923905', 'user_today_stat', '今天玩家统计', 'select a.account,a.username, date_format(DATE_SUB(now(),INTERVAL 1 DAY),\'%Y-%m-%d\')yearmonth, ifnull(a.amount,0)usersum, ifnull(a.balancepal,0)balasum,ifnull(b.rechsum,0)rechsum,\n            ifnull(c.withsum,0)withsum,ifnull(d.givesum,0)givesum,ifnull(e.betsum,0)betsum,ifnull(f.winsum,0)winsum,(ifnull(f.winsum,0)-ifnull(e.betsum,0))profit from\n         (select id, account, username,amount, balancepal from pt_member where vipflag=\'1\')a left join\n         (select uid, sum(iamount) rechsum from mem_bill where billtype=\'Reharge\' and DATEDIFF(create_time,NOW())=0 group by uid)b on a.id=b.uid left join\n         (select uid, sum(amount) withsum from mem_withdrawal where withstatus=\'1\' and DATEDIFF(checktime,NOW())=0 group by uid)c on a.id=c.uid left join\n         (select uid, sum(iamount) givesum from mem_bill where billtype=\'Give\' and DATEDIFF(create_time,NOW())=0 group by uid)d on a.id=d.uid left join\n         (select uid, sum(oamount) betsum from mem_bill where billtype=\'Bet\' and DATEDIFF(create_time,NOW())=0 and uid in(select id from pt_member where vipflag=\'1\') group by uid)e on a.id=e.uid left join\n         (select uid, sum(iamount) winsum from mem_bill where billtype=\'Win\' and DATEDIFF(create_time,NOW())=0 and uid in(select id from pt_member where vipflag=\'1\') group by uid)f on a.id=f.uid\n         group by profit ', null, null, '1', null, null, null, null, '2022-07-30 15:05:42', 'admin');
