-- ----------------------------
-- Function structure for currval
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS bigint(20)
    DETERMINISTIC
BEGIN
    DECLARE value VARCHAR(20);
    SET value = 0;
    SELECT current_value INTO value
    FROM pt_sequence
    WHERE name = seq_name;
    RETURN value;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS bigint(20)
    DETERMINISTIC
BEGIN
    UPDATE pt_sequence
    SET current_value = current_value + increment
    WHERE name = seq_name;#更新序列号
    RETURN currval(seq_name);#取当前序列号
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for setval
-- ----------------------------
DROP FUNCTION IF EXISTS `setval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `setval`(seq_name VARCHAR(50), value BIGINT) RETURNS bigint(20)
    DETERMINISTIC
BEGIN
    #初始化更新
    UPDATE pt_sequence
    SET current_value = value
    WHERE name = seq_name;
    #返回序列当前值
    RETURN currval(seq_name);
END
;;
DELIMITER ;
